window.bookSummaryJSON = "<p>Tatiana, Claudia, Calvin, and Sasha have been lured to school by a clever clairvoyant named Jonas. Jonas Goodwin's test is to uncover each of their darkest, most perverted secrets. If Jonas can discover how each teen connects to the biggest catastrophe to rock the tiny suburb of Seville, Texas, he will earn his place at the grim reaper's right hand. </p> <p>Except, there is more at stake than a mere test. </p> <p>Lucifer is not one to be shortchanged or denied. The reaper has come up short on his next delivery of souls. It is now up to the grim reaper's newest protégé to fill the devil's quota of souls on that next train heading downtown…or else. </p>"; 
